sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = inputs.response_body;

    var premium = null;	
  var quoteId = null;
  var variant_id = null;
  var plan = null;

  if (responseBody) {
    var parsedResponse = JSON.parse(responseBody);
    if (parsedResponse && parsedResponse.pInObj1_inout) {
      var pInObj1_inout = parsedResponse.pInObj1_inout;
      premium = pInObj1_inout.stringval150 ? JSON.parse(pInObj1_inout.stringval150).modal_PREM : null;
      quoteId = pInObj1_inout.stringval150 ? JSON.parse(pInObj1_inout.stringval150).balic_Quoteid : null;
      plan = pInObj1_inout.stringval30;
    }
    if (parsedResponse && parsedResponse.pInList1_inout && parsedResponse.pInList1_inout.WeoRecStrings150User && parsedResponse.pInList1_inout.WeoRecStrings150User.length > 0) {
      variant_id = parsedResponse.pInList1_inout.WeoRecStrings150User[0].stringval1;
    }
  }
  outputs.res={
    "status": "success",
    'QuoteId': quoteId,
    "plan": plan,
    'variant': variant_id,
    'premium': premium
  }


})(inputs, outputs);

