sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var gr=new GlideRecord('x_rptp_insureme_response_table')
gr.addQuery("sys_id","8f050ed947358e50e9ddbf66706d434f");
gr.query();
if(gr.next()){
    outputs.data=gr.reponse;
}

var prodCode="331";
var prodVariantName="JOINT_LIFE_WEALTH";
var prodVarCode="L183C01";
var flag=false;
var gr=new GlideRecord('x_rptp_insureme_insuranceproduct');
gr.query();
outputs.val=false;
while(gr.next()){
    if(gr.code==prodCode){
        flag==true;
        break;
    }
}

if(flag){
    var gr=new GlideRecord('x_rptp_insureme_insuranceproductvariant');
    gr.query();
    while(gr.next()){
        if(gr.name==prodVariantName && gr.code==prodVarCode){
            outputs.val=true;
            break;
        }
    }
}


})(inputs, outputs);

